import React from "react";

import "./customButton.scss";

const CustomButton = ({ children, isgooglesignin, ...otherbuttonprops }) => {
  return (
    <button
      className={`${isgooglesignin ? "googlesignin" : ""} custom-button`}
      {...otherbuttonprops}
    >
      {children}
    </button>
  );
};

export default CustomButton;
